import React from "react";

function Search(){
    return(
        <div class="Searchbar">
            <form>
                <button type="submit" class="w3-right"></button>
                <input class="w3-right" type="text" placeholder="Search for Recipes..."/>
            </form>
        </div>
    );
}

export default Search;
